import React from "react";
import ToggleMenu from "./ToggleMenu";
import "../css/NavBar.css"
const NavBar = () => {
  return (
    <div className="body">
      <div>
        <ToggleMenu />
      </div>
      <h1>안녕하세요</h1>
    </div>
  );
};

export default NavBar;
